import React from 'react'
import {Logo,BurgerIcon,ListIcon,ProfileIcon} from '@ya.praktikum/react-developer-burger-ui-components'
import styles from "../AppHeader/AppHeader.module.css";

function AppHeader() {
  return (
    <div className={styles.appHeader}>
        <div style={{  justifyContent: 'start'}}>
    <BurgerIcon type="primary" /><span style={{  color: 'white', padding: 16 }} className="p-4">конструктор</span>
    <ListIcon type="primary" /><span style={{  color: 'white', padding: '16px' }} className="p-4">лента заказов</span>
    </div>
    <Logo  className="logo" />
    <ProfileIcon type="primary" /><span style={{  color: 'white', padding: 16 }} className="p-4">личный кабинет</span>
  </div>
);
}

export default AppHeader
